css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix(http://www.youtube),
               url-prefix(https://www.youtube) 
{
@font-face {
  font-family: 'Montserrat';
  font-style: normal;
  font-weight: 400;
  src: url(https://fonts.gstatic.com/s/montserrat/v6/zhcz-_WihjSQC0oHJ9TCYPk_vArhqVIZ0nv9q090hN8.woff2) format('woff2');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2212, U+2215, U+E0FF, U+EFFD, U+F000;
}



  /*Etc.*/

.watched .video-thumb{
      opacity: 1 !important;
    }

#footer-links{
    display: none !important;
      visibility: hidden !important;
    }
    
    body #footer-container{
      margin-top: 0px;
    }
    
    #body-container{
      padding-bottom: 95px;
    }
    

.yt-uix-button-subscribe-branded::before{
      background: no-repeat url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAMCAYAAABr5z2BAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAAYdEVYdFNvZnR3YXJlAHBhaW50Lm5ldCA0LjAuOWwzfk4AAABPSURBVDhPvZIxCgAgDAN9YXf/D64+oXqgmwa14EGWltyU5O7WU3puoWMIXsqTgiCEEuQRiRLwI1JyKqgcVnwTbFECirIMSnAEgvCQAlN2awXO7EtpOuonAAAAAElFTkSuQmCC)
    }
 
.yt-uix-button-subscribe-branded, .yt-uix-button-subscribe-branded[disabled], .yt-uix-button-subscribe-branded[disabled]:active, .yt-uix-button-subscribe-branded[disabled]:focus, #yt-masthead-user .sb-notif-on .yt-uix-button-content,.yt-uix-button-primary, .yt-uix-button-primary[disabled], .yt-uix-button-primary[disabled]:hover, .yt-uix-button-primary[disabled]:active, .yt-uix-button-primary[disabled]:focus{
      background-color: /*[[ytcolor1]]*/ !important;
    }

    .epic-nav-item-heading, a.yt-uix-button-epic-nav-item:hover{
      border-color: /*[[ytcolor1]]*/ !important;
    }
    
    .yt-uix-button-subscribe-branded:hover{
      filter: brightness(85%);
    }


 
.watched-badge{
      position: unset;
      color: #000;
      background-color: #FFF;
      opacity: 1;
    }
  
.content-region{
    margin-left: -20px !important;
    margin-top: -2px !important;
    font-size: 10px !important;
    color: #FFF !important;
  }
  
  #appbar-guide-button {

  margin-left: 85px !important;

  }
  .exp-hamburglar #appbar-guide-button {
  
  margin-left: 85px !important;
  
  }

   #yt-masthead #logo-container .logo {

  margin-left: -120px !important;

  }
  
  
  .yt-thumb img{
    border-radius: 10% !important;
  }
  
  .yt-thumb{
  background: #FFF none repeat scroll 0% 0%;
  }
  
  .yt-card{
    margin: 0px 0px 0px;
  }
  
  .live-chat-widget #live-comments-setting-bottom-scroll , .ytp-swatch-background-color, .ytp-swatch-background-color-secondary , .ytp-volume-slider-track , .ytp-live-badge[disabled]::before , .ytp-menuitem[aria-checked="true"] .ytp-menuitem-toggle-checkbox , .ytp-settings-button.ytp-hd-quality-badge::after, .ytp-settings-button.ytp-4k-quality-badge::after, .ytp-settings-button.ytp-5k-quality-badge::after, .ytp-settings-button.ytp-8k-quality-badge::after, .ytp-volume-slider-handle::before{
    background-color: /*[[ytcolor1]]*/ !important;
  }
  
  .guide-item.guide-item-selected{
    background: /*[[ytcolor1]]*/ !important;
  }

  .ytp-swatch-color , li.guide-section h3 a, #progress{
    color: /*[[ytcolor1]]*/ !important;
  }
  /*Custom logos*/
#yt-masthead #logo-container .logo , #footer-logo .footer-logo-icon{
  background: transparent url(data:image/png;base64,) no-repeat scroll -1px -4px / 76px 37px !important; 
                               
}
/*Likes and dislikes bar*/
  
.video-extras-sparkbar-dislikes{
  background: #EC1D1D none repeat scroll 0% 0% !important;
}
  
.video-extras-sparkbar-likes{
  background: rgb(51, 230, 24) none repeat scroll 0% 0% !important;
}
/*Comments and CPs*/
  
.yt-thumb-clip img, .yt-thumb-clip .vertical-align , .channel-header-profile-image , .comments .comment-item .user-photo , #appbar-nav .appbar-nav-avatar , #dOc{
  border-radius: 50% !important;
}
  
  img[width="160"],img[width="196"], img[width="170"], img[width="120"], img[width="72"], img[width="110"],img[width="370"],img[width="224"],img[width="106"],img[width="288"],img[width="80"],img[width="150"],img[width="150"] [height="84"],img[width="50"],img[width="402"],img[width="124"]{

	border-radius: 0px!important;

}

  body, input, button, textarea, select{
   font-family: 'Montserrat','Montserrat',sans-serif 
  }
  
.channel-header-profile-image-container{
    background: rgba(0, 0, 0, 0)
}  

.yt-thumb-clip{
  background: rgb(255, 255, 255) none repeat scroll 0% 0%;
}
  
}
